import { createAsyncThunk, createSlice } from '@reduxjs/toolkit';

export const campaignThunk = createAsyncThunk('campaignThunk', async () => {
  //make api call
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      return resolve([
        {
          name: 'Nissan',
          id: '123',
          description: 'This is Nissan campaign',
          status: '1',
          image:
            'data:image/jpeg;base64,',
        },
        {
          name: 'BMW',
          id: '456',
          description: 'This is BMW campaign',
          status: '1',
          image:
            'data:image/jpeg;base64,',
        },
        {
          name: 'Audi',
          id: '789',
          description: 'This is Audi campaign',
          status: '0',
          image:
            'data:image/jpeg;base64,',
        },
        {
          name: 'Volvo',
          id: '910',
          description: 'This is Volvo campaign',
          status: '1',
          image:
            'data:image/jpeg;base64,',
        },
        {
          name: 'G-Wagon',
          id: '1112',
          description: 'This is G-Wagon campaign',
          status: '0',
          image:
            'data:image/jpeg;base64,',
        },
        {
          name: 'BMW M-5',
          id: '1213',
          description: 'This is BMW M-5 campaign',
          status: '1',
          image:
            'data:image/jpeg;base64,',
        },
      ]);
    }, 2000);
  });
});

const CampaignSlice = createSlice({
  name: 'Campaign_Details',
  initialState: {
    loader: false,
    data: [],
    error: null,
  },
  reducers: {
    setCampaigns: (state, action) => {
      return action.payload;
    },
  },
  extraReducers: (builder) => {
    builder
      .addCase(campaignThunk.pending, (state) => {
        state.loader = true;
        state.error = null;
      })
      .addCase(campaignThunk.fulfilled, (state, action) => {
        state.loader = false;
        state.data = action.payload;
      })
      .addCase(campaignThunk.rejected, (state, action) => {
        state.loader = false;
        state.error = action.error.message;
      });
  },
});

export const { setCampaigns } = CampaignSlice.actions;
export default CampaignSlice.reducer;
